import React from "react";
import Button from "react-bootstrap/Button"

function Sort(props){
    return(
        <Button className="col-sm-8 offset-2" variant="primary" type="submit" onClick={props.handleSort}>
        Sort by Age
        </Button>
    )
}

export default Sort;
